import React from "react";
import "./SideBar.css"
import testIcon from "../Resources/magnifier.png"

class SideBar extends React.Component
{   
    render()
    {
        console.log(this.props.IsOpened);

        return (
        <div className={this.props.IsOpened? "SideBar Open" : "SideBar"}>
            <div> I slide into view </div>
            <div> Me Too! </div>
            <div> Me Three! </div>
        </div>
        );
    }
}



class SideBarUnit extends React.Component
{
    state = 
    {
        mouseOn : false,
    }

    render()
    {
        return (<div>
            <img src={testIcon}>  </img>
            <p onClick={()=>{  window.location.replace('/search/' + this.state.searchString)  }}
            >{this.props.name}</p>
        </div>)
    }
}

export default SideBar;
